import React from "react";
export default class Classe extends React.Component{
    constructor(props){
        super(props)
        this.modelo = 'HRV'
        this.estado={
            ligado:false,
            velocidade:0,
        }

    }

    render(){
        return(
            <div>
                <h1>Meu Carro</h1>
                <p>Modelo: {this.modelo}</p>
                <p>Ligado: {this.estado.ligado}</p>
                <p>Velocidade: {this.estado.velocidade}</p>
            </div>
        )
    }
}
